import React, { Component } from "react";
import { Link } from "react-router-dom";
import * as $ from "jquery";

class BN {
  tittel: string;
  beskrivelse: string;
  imdbUrl: string;
  bildeUrl: string;
  forslagsGiver: string;

  constructor(
    tittel: string,
    beskrivelse: string,
    imdbUrl?: string,
    bildeUrl: string,
    forslagsGiver: string
  ) {
    this.tittel = tittel;
    this.beskrivelse = beskrivelse;
    this.imdbUrl = imdbUrl;
    this.bildeUrl = bildeUrl;
    this.forslagsGiver = forslagsGiver;
  }
}

export default class BigNews extends Component<{
  title?: string,
  src?: string,
  alt?: string,
  href?: string
}> {

  render() {
    return (
      <div className="col-sm-">
        <Link className="text-body" exact to={this.props.href}>
          <div
            className="card mx-auto bg-danger border-0"
            style={{ width: "auto" }}
          >
            <div>
              <img
                src={this.props.src}
                className="img-fluid"
                alt={this.props.alt}
              />
            </div>
            <div className="card-body">
              <h1 className="text-center">{this.props.title}</h1>
            </div>
          </div>
        </Link>
      </div>
    );
  }
}
